import * as actionTypes from './actionTypes';

export const inputFocus = () => ({
  type: actionTypes.INPUT_FOCUS
});

export const inputBlur = () => ({
  type: actionTypes.INPUT_BLUR
});

export const getList = () => {
  return (dispatch) => {
    console.log('dickyyy');
  }
}
